import React from "react";
const $Header = $.header`
  background-color: #fff159;
  margin: 0;
  padding: 7px;
  color: #8f8f8f !important;
  box-shadow: var(--shadow);
`;
const Header = () => {
  return (
    <$Header>
    </$Header>
  );
};

export default Header;
